    }
    render() {

        return (
          <nav className="header-wrapper">

          <div className="nav-wrapper">
            <div className="navigation">
              <NavLink to="/about" activeClassName="activeClass">
                About
              </NavLink>
              <NavLink to="/contact" activeClassName="activeClass">
                Contact
